import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract visible user profile data
    await page.waitForSelector('input[placeholder="Email or phone number"]');
    const email = await page.$eval('input[placeholder="Email or phone number"]', el => el.value);

    await page.waitForSelector('input[placeholder="Password"]');
    const password = await page.$eval('input[placeholder="Password"]', el => el.value);

    // Assuming we want to extract the user's name from the email
    const userName = email.includes('@') ? email.split('@')[0] : email;

    // Take a screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted visible user profile data",
      extractedData: {
        email,
        password,
        userName
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

